#nullable enable // autogenerated

using System.Collections.Generic;
using System.Xml;

namespace MVZ2.Metas
{
    public class ProgressBarMetaList
    {
        public ProgressBarMeta[] metas;

        public ProgressBarMetaList(ProgressBarMeta[] metas)
        {
            this.metas = metas;
        }

        public static ProgressBarMetaList FromXmlNode(XmlNode node, string defaultNsp)
        {
            var resources = new List<ProgressBarMeta>();
            for (int i = 0; i < node.ChildNodes.Count; i++)
            {
                var meta = ProgressBarMeta.FromXmlNode(node.ChildNodes[i], defaultNsp);
                if (meta != null)
                    resources.Add(meta);
            }
            return new ProgressBarMetaList(resources.ToArray());
        }
    }
}
